import React, { Component } from 'react'
import SoundIcon from '../../../Icons/SoundIcon'
import PlayListIcon from '../../../Icons/PlayListIcon'
export default class Func extends Component {
  render() {
    return (
      <ul className='Func'>
        <li>
          <SoundIcon></SoundIcon><div className='soundController'>
          <div></div>
          </div></li>
        <li><PlayListIcon></PlayListIcon></li> 
        
        <div className='PlayListBorad'></div>
      </ul>
    )
  }
}
